import React from "react";
import Header from "./header.js";
import { Backgroundrouter as Router, Switch, Route } from "react-dom-router";
import Body from "./body.js";

function App() {
  return (
    <React.StrictMode>
      <Header />
      <Router>
        <Body />
      </Router>
    </React.StrictMode>
  );
}

export default App;
